import React from 'react'
import { LogOut } from 'lucide-react';
import './nurseNave.css'

function NurseNave() {
    return (
        <div>
            <nav className='nurseNav'>
                <div><img src="./logo.png" alt="logo" className='logoo' /><span className='titlee'>Health</span></div>
                <h4 id='per'>Hello Health</h4>
                <button className='Logout'><LogOut /> Logout</button>
            </nav>
        </div>
    )
}

export default NurseNave
